import React from 'react';
import Timer from './Timer';

class TimersList extends React.Component {
    render() {
        const listOfTimers = information.map((info, index) => {
            return <Timer info={info} index={index}></Timer>
        });

        return (
            <div>
                <h3>TimersList starts here</h3>
                <ul>
                    {listOfTimers}
                </ul>
            </div>
        )
    }
}

const information = [
    {title: "Learn React", initialTime: 0},
    {title: "Learn JS", initialTime: 0},
    {title: "Learn Datastructures", initialTime: 0},
    {title: "Learn Algorithms", initialTime: 0},
    {title: "Learn Git Advances", initialTime: 0},
]

export default TimersList;
